func TestBase64(t *testing.T) {
	base64Str := "eyLnjrvmiYciOjAsIui/nuaOpeS7tiI6MCwi5qGGIjoxLCLmlbTmiYciOjAsIui9rOinkiI6MSwi5ou85qiYIjowLCLnurHmiYciOjAsIuaJh+eOuyI6MCwi5YyF5aWXIjowLCLmooMiOjAsIumYsuaKpOagjyI6MCwi5Zu65467IjowLCLmlrnpgJoiOjAsIuWbuuWumuS6riI6MCwi6L2s5o2i5qGGIjowfQ==\n"
	// Step 1: Base64解码
	decodedBytes, err := base64.StdEncoding.DecodeString(base64Str)
	if err != nil {
		log.Fatalf("Base64解码错误: %v", err)
	}

	// Step 2: JSON解析
	var result map[string]interface{}
	err = json.Unmarshal(decodedBytes, &result)
	if err != nil {
		log.Fatalf("JSON解析错误: %v", err)
	}
	for k, v := range result {
		fmt.Println(k, " = ", v)
	}

	fmt.Println(result) // 输出解析后的数据
}

