func TestGetField(t *testing.T) {
	fmt.Println(ddd(MdeUserplan{}))
}

func ddd(m interface{}) []string {
	sl := make([]string, 0)
	// 使用反射获取User结构体类型
	userType := reflect.ValueOf(m)
	if userType.Kind() == reflect.Ptr {
		userType = userType.Elem()
	}
	typ := userType.Type()
	// 遍历User结构体的所有字段
	for i := 0; i < typ.NumField(); i++ {
		field := typ.Field(i)
		if field.Type.Kind() == reflect.Struct {
			strings := ddd(userType.Field(i).Interface())
			sl = append(sl, strings...)
		}
		// 打印字段名称
		//fmt.Printf("Field Name: %s\n", field.Name)
		// 如果需要，你也可以获取更多关于字段的信息，如标签等
		//fmt.Printf("Tag Value: %s\n", field.Tag.Get("gorm"))
		tagName := extractColumnFromTag(field.Tag.Get("gorm"))
		if tagName != "" {
			sl = append(sl, tagName)
		}
	}
	return sl
}

func extractColumnFromTag(tagValue string) string {
	parts := strings.Split(tagValue, ";") // 首先按分号分割标签值为多个部分
	for _, part := range parts {
		kv := strings.Split(part, ":") // 再次按冒号分割每部分为键值对
		if len(kv) == 2 && kv[0] == "column" {
			return kv[1] // 返回"column"后的值
		}
	}
	return ""
}

func TestBaseJson(t *testing.T) {
	saveDataStr := ""
	saveData, err := base64.StdEncoding.DecodeString(saveDataStr)
	if err != nil {
		fmt.Println(err.Error())
	}
	strData := string(saveData)
	strData = strings.Replace(strData, "/&quot;/", "\"", -1)
	saveData = []byte(strData)
	var getinfoss map[string]interface{}
	err = json.Unmarshal(saveData, &getinfoss)
	if err != nil {
		fmt.Println("Error decoding JSON:", err)
		return
	}

	// 初始化data和infoss映射
	infoss := make(map[string]interface{})
	if val, ok := getinfoss["install"]; ok {
		infoss["install"] = val
	}
	if val, ok := getinfoss["memo"]; ok {
		infoss["memo"] = val
	}
	if parts, ok := getinfoss["parts"].([]interface{}); ok {
		for _, part := range parts {
			if partMap, ok := part.(map[string]interface{}); ok {
				if code, ok := partMap["code"].(string); ok && code == "metal_fan" {
					if offsetFanBottom, ok := partMap["offsetFanBottom"].(float64); ok {
						infoss["offsetFanBottom"] = offsetFanBottom
						break
					}
				}
			}
		}
	}

	fmt.Printf("Converted data in Go: %+v\n", infoss)

}

func TestSplitStr2(t *testing.T) {
	// 解析packaInfo
	packaInfoStr := "框-1"
	packaInfoData := strings.Split(packaInfoStr, ",")
	packaInfo := make(map[string]string)
	for _, v := range packaInfoData {
		pair := strings.Split(v, "-")
		if len(pair) == 2 {
			packaInfo[pair[0]] = pair[1]
		}
	}

	var frames int
	if frameVal, ok := packaInfo["框条"]; ok {
		frames = atoi(frameVal)
	} else if frameVal, ok := packaInfo["框"]; ok {
		frames = atoi(frameVal)
	}

	// 构建data
	data := map[string]interface{}{
		"packaInfo":    packaInfoStr,
		"frames":       frames,
		"sticks":       atoi(packaInfo["梃"]),
		"fanGlasses":   atoi(packaInfo["玻扇"]),
		"fanYarns":     atoi(packaInfo["纱扇"]),
		"fanGauzes":    atoi(packaInfo["其他扇"]),
		"glassBrights": atoi(packaInfo["固玻"]),
		"glassActives": atoi(packaInfo["扇玻"]),
		"corners":      atoi(packaInfo["转角料"]),
		"bordures":     atoi(packaInfo["包套"]),
		"metal":        atoi(packaInfo["配件"]),
		"actives":      atoi(packaInfo["框整扇"]),
	}

	fmt.Println(data)
}

func atoi(s string) int {
	i, _ := strconv.Atoi(s)
	return i
}

